\u0456\u0441\u0442\u043a\u0430\u00bb, 2015\u0440.\n\ud83d\udfe2\u00ab\u0422\u0435\u0440\u043c\u0456\u043d\u0430\u0442\u043e\u0440\u00bb, 2009\u0440.\n\ud83d\udfe2\u00ab\u0406\u0434\u0456\u043a\u0442\u043e\u0440\u0456\u044f\u00bb, 2006\u0440.\n\u0415\u043d\u0434\u0456 \u0421\u0435\u043c\u0431\u0435\u0440\u0433 (3 \u0444\u043e\u0442\u043e):\n\ud83d\udfe1\u00ab\u0421\u0435\u043a\u0441 \u043f\u043e \u0434\u0440\u0443\u0436\u0431\u0456\u00bb, 2011\u0440.\n\ud83d\udfe1\u00ab\u0421\u0443\u0441\u0456\u0434\u0438\u00bb, 2014\u0440.\n\ud83d\udfe1\u00ab\u041e\u0434\u043d\u043e\u043a\u043b\u0430\u0441\u043d\u0438\u043a\u0438 2\u00bb, 2013\u0440.\n\ud83d\udfe1\u00ab\u041d\u043e\u0432\u0435\u043d\u044c\u043a\u0430\u00bb, 2011\u0440.\n\ud83d\udfe1\u00ab\u0421\u0435\u043b\u0435\u0441\u0442\u0430 \u0456 \u0414\u0436\u0435\u0441\u0441\u0456 \u043d\u0430\u0432\u0456\u043a\u0438\u00bb, 2012.\n\u0414\u0436\u043e \u041b\u043e \u0422\u0440\u0443\u0433\u043b\u0456\u043e (4 \u0444\u043e\u0442\u043e):\n\ud83d\udfe0\u00ab\u041f\u0440\u043e\u0441\u0442\u0456\u0448\u0435 \u043f\u0440\u043e\u0441\u0442\u043e\u0433\u043e\u00bb, 2016\u0440.\n\ud83d\udfe0\u00ab\u0421\u043f\u0435\u043a\u043e\u0442\u043d\u0435 \u0432\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u0435 \u043b\u0456\u0442\u043e: 10 \u0440\u043e\u043a\u0456\u0432 \u043f\u043e\u0442\u043e\u043c\u0443\u00bb, 2017\u0440.\n\ud83d\udfe0\u00ab\u0406\u0434\u0435\u0430\u043b\u044c\u043d\u0438\u0439 \u0433\u043e\u043b\u043e\u0441 2\u00bb, 2015\u0440.\n\ud83d\udfe0\u00ab\u0414\u0443\u0440\u043d\u0438\u0439 \u0456 \u0431\u0435\u0437\u0433\u043b\u0443\u0437\u0434\u0438\u0439 \u0436\u0435\u0441\u0442\u00bb, 2018\u0440.\n\ud83d\udfe0\u00ab\u041b\u0438\u0446\u0430\u0440 \u043a\u0443\u0431\u043a\u0456\u0432\u00bb, 2015\u0440.\n\u0410\u043d\u0434\u0440\u0435 \u0411\u0440\u043e\u0433\u0435\u0440 (5 \u0444\u043e\u0442\u043e):\n\ud83d\udd34\u00ab\u0421\u043e\u043b\u0442\u00bb, 2010\u0440.\n\ud83d\udd34\u00ab\u0424\u0430\u043d\u0442\u0430\u0441\u0442\u0438\u0447\u043d\u0430 \u0447\u0435\u0442\u0432\u0456\u0440\u043a\u0430\u00bb, 2007\u0440.\n\ud83d\udd34\u00ab\u041c\u0456\u0441\u0442\u043e \u0430\u043d\u0433\u0435\u043b\u0456\u0432\u00bb, 1998\u0440.\n\ud83d\udd34\u00ab\u041f\u0430\u0441\u0430\u0436\u0438\u0440\u0438\u00bb, 2008\u0440.\n\ud83d\udd34\u00ab\u0411\u0435\u0439\u0442\u0430\u0443\u043d \u043f\u043e\u0437\u0430 \u0437\u0430\u043a\u043e\u043d\u043e\u043c\u00bb, 2012\u0440."}}]},"shortcode":"B9xASmPB-OY","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584299797,"dimensions":{"height":750,"width":750},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89685325_517699545599475_9130114768049689334_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=7P7Jb8_yj0oAX82Imrs\u0026oh=49314425d6783d1de0273d1b4150cbad\u0026oe=5E9BAEFB","edge_liked_by":{"count":4},"edge_media_preview_like":{"count":4},"owner":{"id":"31385577221"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89685325_517699545599475_9130114768049689334_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=7P7Jb8_yj0oAX82Imrs\u0026oh=bb93fd3ac9efe14edf5e3448b15ab855\u0026oe=5EA0E81E","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89685325_517699545599475_9130114768049689334_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=7P7Jb8_yj0oAX82Imrs\u0026oh=be38dedc2a9351b47fb26c87052a06af\u0026oe=5EA17BB9","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89685325_517699545599475_9130114768049689334_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=7P7Jb8_yj0oAX82Imrs\u0026oh=0c0141d09c85a86b1285b553053c0c29\u0026oe=5EA1DEF3","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/89685325_517699545599
